    <div>
      <div>
        <label>
          제목 :
          <input type="text" />
        </label>
      </div>
      <div>
        <label>
          내용 :
          <input type="text" />
        </label>
      </div>
      <button>등록하기</button>
    </div>
  );
}

export default PostEdit;
